package cn.gov.zcy.a.rpc.impl;

import org.apache.dubbo.config.annotation.DubboService;

import cn.gov.zcy.a.model.HelloWorldRequest;
import cn.gov.zcy.a.model.HelloWorldResponse;
import cn.gov.zcy.a.model.Response;
import cn.gov.zcy.a.service.HelloA;
import com.google.common.collect.Lists;

import java.util.List;

/**
 * @author 水手
 * @since 2022/1/18 10:13 上午
 */
@DubboService(version = "1.0.0", timeout = 10000)
public class HelloWorldImpl implements HelloA {

    @Override
    public String helloWorld(HelloWorldRequest request) {
        return request.getMessage();
    }

    @Override
    public String helloWorld(String a, String b) {
        return "a" + "b";
    }

    @Override
    public Response<List<HelloWorldResponse>> helloWorld(Long a) {

        String aa = "";
        StringBuffer stringBuffer = new StringBuffer();
        for(int i = 0; i < 8; i++){
            aa = aa + aa;
            if(i == 7) {
                stringBuffer.append(aa);
            }
        }
        HelloWorldResponse response = new HelloWorldResponse();
        response.setDto(stringBuffer.toString());
        response.setName("name");
        response.setValue("nameValue");
//        try {
//            Thread.sleep(15000);
//        } catch (InterruptedException e) {
//            e.printStackTrace();
//        }
        return Response.ok(Lists.newArrayList(response));
    }

    @Override
    public String helloWorld(List<Long> b) {
        return "b";
    }
}
